import React from "react";
import axios from "axios";

const Episodes = () => {
  const fetchData = () => {
    return axios.get("https://api.sampleapis.com/futurama/episodes").then();
  };
  return <div>Episodes</div>;
};

export default Episodes;

// https://api.sampleapis.com/futurama/episodes
